import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const ZReport = () => {
  const [startHour, setStartHour] = useState(0);
  const [endHour, setEndHour] = useState(23);
  const [reportData, setReportData] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();

  // Fetch report data based on selected time range
  const fetchReport = async () => {
    setIsLoading(true);
    try {
      const response = await axios.get("http://localhost:5050/api/zreport", {
        params: { startHour, endHour }
      });
      setReportData(response.data);
      setIsLoading(false);
    } catch (error) {
      console.error("Error fetching report data:", error);
      setIsLoading(false);
    }
  };

  // Handle export to CSV
  const exportToCSV = () => {
    const csvData = reportData.map(row => 
      Object.values(row).join(",")
    ).join("\n");

    const blob = new Blob([csvData], { type: "text/csv" });
    const link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = "Z_Report.csv";
    link.click();
  };

  // Handle time range change
  const handleStartHourChange = (e) => setStartHour(parseInt(e.target.value));
  const handleEndHourChange = (e) => setEndHour(parseInt(e.target.value));

  // Navigate back
  const handleBack = () => {
    navigate(-1);
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>📝 Z-Report: Hourly Sales Breakdown</h2>
      <button onClick={handleBack}>🔙 Back</button>

      <div style={{ marginTop: "20px" }}>
        <label>Start Hour:</label>
        <select value={startHour} onChange={handleStartHourChange}>
          {[...Array(24).keys()].map(hour => (
            <option key={hour} value={hour}>{hour}:00</option>
          ))}
        </select>

        <label>End Hour:</label>
        <select value={endHour} onChange={handleEndHourChange}>
          {[...Array(24).keys()].map(hour => (
            <option key={hour} value={hour}>{hour}:00</option>
          ))}
        </select>

        <button onClick={fetchReport} style={{ marginLeft: "10px" }}>
          Generate Report
        </button>
      </div>

      {isLoading ? (
        <p>Loading...</p>
      ) : (
        <>
          <h3>📊 Sales Report</h3>
          {reportData.length > 0 ? (
            <table border="1" style={{ width: "100%", marginTop: "20px" }}>
              <thead>
                <tr>
                  <th>Hour</th>
                  <th>Transactions</th>
                  <th>Sales Revenue</th>
                  <th>Total Sales</th>
                  <th>Total Tax</th>
                  <th>Service Charges</th>
                  <th>Voids</th>
                  <th>Discards</th>
                  <th>Discounts</th>
                  <th>Employee Signatures</th>
                  <th>Payment Methods</th>
                </tr>
              </thead>
              <tbody>
                {reportData.map((row, index) => (
                  <tr key={index}>
                    <td>{row.hour}</td>
                    <td>{row.total_transactions}</td>
                    <td>{row.sales_revenue.toFixed(2)}</td>
                    <td>{row.total_sales.toFixed(2)}</td>
                    <td>{row.total_tax.toFixed(2)}</td>
                    <td>{row.service_charges.toFixed(2)}</td>
                    <td>{row.voids.toFixed(2)}</td>
                    <td>{row.discards.toFixed(2)}</td>
                    <td>{row.discounts.toFixed(2)}</td>
                    <td>{row.employee_signatures}</td>
                    <td>{row.payment_methods}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>No data available for the selected time range.</p>
          )}

          {reportData.length > 0 && (
            <button onClick={exportToCSV} style={{ marginTop: "20px" }}>
              Export to CSV
            </button>
          )}
        </>
      )}
    </div>
  );
};

export default ZReport;
